import { fromJS } from 'immutable';

const defaultState = fromJS({
	topicList: [{
		id: 1,
		title: '社会热点',
		imgUrl: 'https://upload-images.jianshu.io/upload_images/2804351-516ad0ba98025035.jpg?imageMogr2/auto-orient/strip%7CimageView2/2/w/640/format/webp'
		},{
			id: 2,
			title: '手绘',
			imgUrl: 'https://upload-images.jianshu.io/upload_images/2804351-516ad0ba98025035.jpg?imageMogr2/auto-orient/strip%7CimageView2/2/w/640/format/webp'
	}]
});

export default (state = defaultState, action) => {
	switch(action.type) {
		default:
			return state;
	}
}
